import React, { useState } from "react";

import { Link,useNavigate } from "react-router-dom";
import { useAuth } from '../../Context/AuthContext';

const Sidebar = ({ toggle }) => {
  const [step1, setStep1] = useState(1);
  const { logout } = useAuth();
  const Naviagate = useNavigate();



  const handleLogout = () => {
    logout();
    Naviagate("/");
  };
  return (
    <aside
      className="d-flex justify-content-between flex-column  text-black vh-100 pe-5"
      style={{ backgroundColor: "#333547" }}
    >
      <div className="ms-3">
        <Link to="/Dashboard">
          {/* <i clLinkssName='bi bi-code-slash fs-4 me-4'></i> */}
          <img
            src="../MMLogo3.png"
            style={{ height: "35px" }}
            className="ms-3 mt-2 "
            alt="CoolBrand"
          />
        </Link>
        {/* <hr className='text-secondary '/> */}
        <ul className="nav nav-pills flex-column  list-unstyled  mt-2">
        <div className='p-2  d-flex justify-content-center' style={{color:'#f0e9e9'}}>
  <span className='fs-4 cursor-pointer' onClick={toggle}>
  </span>
</div>
          <li
            className={
              step1 === 1 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(1)}
          >
            <Link to="/dashboard">
              <i className="bi bi-house fs-5  mx-2 "></i>
              <span className="fw-bold">Dashboard</span>
            </Link>
          </li>

          <li
            className={
              step1 === 2 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(2)}
          >
            <Link to="/posts">
              <i class="bi bi-file-earmark-image fs-5  mx-2"></i>
              <span className="fw-bold">Posts</span>
            </Link>
          </li>

          <li
            className={
              step1 === 3 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(3)}
          >
            <Link to="/paparazzi">
              <i class="bi bi-camera-video  fs-5 mx-2"></i>
              <span className="fw-bold">Videos</span>
            </Link>
          </li>
          <li
            className={
              step1 === 4 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(4)}
          >
            <Link to="/dashboard">
              <i class="bi bi-file-earmark-image  fs-5 mx-2"></i>
              <span className="fw-bold">Rss Details</span>
            </Link>
          </li>
          <li
            className={
              step1 === 5 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(5)}
          >
            <Link to="/">
              <i class="bi bi-quote  fs-5 mx-2"></i>
              <span className="fw-bold">Visual Stories</span>
            </Link>
          </li>
          <li
            className={
              step1 === 6 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(6)}
          >
            <Link to="/dashboard">
              <i className="bi bi-newspaper  fs-5 mx-2"></i>
              <span className="fw-bold">Trending News</span>
            </Link>
          </li>
          <li
            className={
              step1 === 7 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(7)}
          >
            <Link to="/dashboard">
              <i className="bi bi-people fs-5  mx-2"></i>
              <span className="fw-bold">Roles</span>
            </Link>
          </li>
          <li
            className={
              step1 === 8 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(8)}
          >
            <Link to="/dashboard">
              <i class="bi bi-people fs-5  mx-2"></i>
              <span className="fw-bold">Create Users</span>
            </Link>
          </li>
          <li
            className={
              step1 === 9 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(9)}
          >
            <Link to="/Category">
              <i className="bi bi-bookmarks-fill  fs-5 mx-2"></i>{" "}
              <span className="fw-bold">Category</span>
            </Link>
          </li>
        </ul>
      </div>

      <div className='p-2  d-flex justify-content-center' style={{color:'#f0e9e9'}}>
  <span className='fs-4 cursor-pointer' onClick={handleLogout}>
    <i className="bi bi-box-arrow-left mx-2 fw-bold"></i> Log out
  </span>
</div>

    </aside>
  );
};

export default Sidebar;
